dey. Kawah putih merupakan sebuah danau yang terbentuk dari letusan Gunung Patuha. Tanah yang bercampur belerang di sekitar kawah ini berwarna putih, lalu warna air yang berada di kawah ini berwarna putih kehijauan, yang unik dari kawah ini adalah airnya kadang berubah warna. Kawah ini berada pada ketinggian +2090 m dpl dibawah puncak/titik tertinggi Gunung Patuha.</p>\n<p>\n	Kawah putih sangat cocok dikunjungi bagi anda serta keluarga, teman atau pasangan untuk dijadikan destinasi wisata alam karena dapat menghilangkan penat dari masalah kehidupan karena sejuk nya suhu di kawah putih dan hirupan udara yang tercampur dengan bau belerang yang menenangkan. Unik nya air berwarna putih kehijauan serta bagus nya pemandangan yang di perlihatkan sangat cocok di jadikan tempat untuk berfoto bersama keluarga ataupun selfie bersama teman dan pasangan.</p>\n<p>\n	Untuk dapat sampai ke kawah putih jika kamu memakai motor atau bus maka wajib parkir di bawah kemudian menaiki mobil ontang-anting (sebutan untuk mobil yang mengantar ke atas).</p>\n<p>\n	Dan jika kamu datang dengan mobil pribadi dapat parkir di areal atas kemudian langsung jalan kaki menuju kawah putih atau dapat parkir di areal bawah kemudian melanjutkan dengan memakai mobil ontang-anting.</p>\n<p>\n	Jarak antara pintu masuk dan juga areal parkir bawah menuju lokasi kawah putih dan areal parkir atas dapat di tempuh dengan sejauh 5 km tentu jarak ini tidak mungkin di tempuh dengan jalan kaki.</p>\n<p>\n	selamat berlibur ke kawah putih</p>\n<p>\n	<strong>Jadwal Kunjungan</strong></p>\n<p>\n	BUKA &nbsp; &nbsp; 07.00 WIB</p>\n<p>\n	TUTUP &nbsp; 17.00 WIB</p>\n<p>\n	<strong>HARGA TIKET MASUK</strong></p>\n<p>\n	ALLDAY/SETIAP HARI (WNI) Rp.18,000/ ORANG</p>\n<p>\n	ALLDAY/SETIAP HARI (WNA/TURIS ASING)&nbsp; Rp.50,000/ ORANG</p>\n<p>\n	PRE WEDDING Rp.500,000</p>\n<p>\n	<strong>JASA LINGKUNGAN</strong></p>\n<p>\n	-AREAL PARKIR DI ATAS</p>\n<p>\n	RODA 4 Rp. 150,000</p>\n<p>\n	-AREAL PARKIR DI BAWAH</p>\n<p>\n	RODA 2/MOTOR &nb